import '../App.css';
import { Navbar } from 'react-bootstrap';

import 'bootstrap/dist/css/bootstrap.css'


const NavbarComponent = () => {
  return(
    <div className='App'>
      <Navbar bg='dark' variant='dark'>
        <Navbar.Brand>
          Filbraga
        </Navbar.Brand>
      </Navbar>
    </div>
  )
}
export default NavbarComponent
